import { React, useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {

    const { restaurants } = useSelector(state => ({ ...state }));
    const [requests, setRequests] = useState('');

    useEffect(() => {
        setRequests(restaurants?.filter(restaurant => restaurant.status === 'requested'));
    }, [restaurants])

    const handleRoute = (name) => {
        navigate(`/admin-restaurant-view-${name}`);
    }

    return (
        <div className='my-5 px-md-5'>
            <div className='row mt-5 pt-5 mx-md-2'>
                <div className='col-lg-8 col-10 offset-lg-2 offset-1 p-md-4 p-3 text-center shadow'>
                    <h3 className='text-center'>Admin Dashboard</h3>
                    <div className='row my-4'>
                        <h5 className='text-start'>New Restaurant Request</h5>
                        {requests?.length && requests.map(restaurant => <div className='col-12'>
                            <form onSubmit={handleRoute(restaurant?.restaurantName)}>
                                <div className='card shadow w-100'>
                                    <div className='card-body row text-center px-5'>
                                        <h4>{restaurant?.restaurantName}</h4>
                                        <div className='col-lg-6 col-12 text-start'>
                                            <label className='col-form-label text-start fw-bold fs-6'>Contact:</label>
                                            <span className='ps-2'>
                                                {restaurant?.contact}
                                            </span>
                                        </div>
                                        <div className='col-lg-6 col-12 text-start'>
                                            <label className='col-form-label text-start fw-bold fs-6'>Email:</label>
                                            <span className='ps-2'>
                                                {restaurant?.email}
                                            </span>
                                        </div>
                                        <div className='col-lg-6 col-12 text-start'>
                                            <label className='col-form-label text-start fw-bold fs-6'>Address:</label>
                                            <span className='ps-2'>
                                                {restaurant?.restaurantAddress}, {restaurant?.city}, {restaurant?.state}, {restaurant?.zipCode}
                                            </span>
                                        </div>
                                    </div>
                                    <div className='card-footer'>
                                        <ul className='list-group flex-row justify-content-center'>
                                            <li className='list-group-item border-0 bg-transparent'>
                                                <button className='btn btn-filled' type='submit'>View</button>
                                            </li>
                                        </ul>
                                    </div>
                                </div>
                            </form>
                        </div>)}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default AdminDashboard;
